  "Broker Comment" : "IN SEPTEMBER OF 1981 I WAS HIRED BY MERRILL LYNCH.  IN DECEMBER I FILED BANKRUPTCY.  I DID NOT KNOW I WAS TO NOTIFY MERRILL IN FEBRUARY OF 1982 MERRILL NOTICED THE DISCHARGE NOTIFICATION IN THE LOCAL PAPER.  I WAS TERMINATED ON 2/14/82. FOUR WEEKS LATER I WAS HIRED BY PAINEWEBBER. HAD I KNOWN THE REPORTING REQUIREMENT.  I WOULD HAVE NOTIFIED MERRILL IN DECEMBER OF '81.  SUPPOSEDLY I WAS SENT NOTIFICATION OF A HEARING REQUEST IN JUNE '82.  AT THAT TIME I WAS WORKING FOR PAINEWEBBER IN TUCSON.  I NEVER RECEIVED THIS NOTIFICATION."
